    public class POP_FLOAT_CLASS {
        public FastWaterModel20ControllerEditor target;
        public string[] contents;
        public string keys;
        public int defaultIndex;
        
        public int VALUE
        {   get
            {   var current = target.target.compiler.GetFloat(keys);
                if (current != 0) return (int)current;
                VALUE = defaultIndex;
                target.target.SetDirty();
                return defaultIndex;
            }
            set { target.target.compiler.SetFloat(keys, value); }
        }
        
        public bool DrawPop(string title, ref Rect r)
        {   // if (r == null) r = EditorGUILayout.GetControlRect(GUILayout.Height(FastWaterModel20ControllerEditor.H));
            r.height = FastWaterModel20ControllerEditor.H;
            bool result = false;
            if (!string.IsNullOrEmpty(title))
            {   EditorGUI.HelpBox(r, title, MessageType.None);
                r.y += r.height;
            }
            
            // var newV = (title != null ? EditorGUI.Popup(r, title, VALUE - 1, contents) : EditorGUI.Popup(r, VALUE - 1, contents)) + 1;
            var newV = EditorGUI.Popup(r, VALUE - 1, contents) + 1;
            if (newV != VALUE)
            {   target.target.Undo(true);
                VALUE = newV;
                target.target.SetDirty();
                result = true;
            }
            r.y += r.height;
            return result;
        }
    }
    
    
    
    
    
    public class POP_CLASS {
        public FastWaterModel20ControllerEditor target;
        public string[] contents;
        public string[] keys;
        public int defaultIndex;
        
        public bool IS(string key)
        {   if (this == null) return false;
            return keys[VALUE] == key;
        }
        
        public int VALUE
        {   get
            {   bool hasnull = false;
                for (int i = 0; i < keys.Length; i++)
                {   if (keys[i] == null)
                    {   hasnull = true;
                        continue;
                    }
                    if (target.target.compiler.IsKeywordEnabled(keys[i])) return i;
                }
                if (hasnull) return 0;
                VALUE = defaultIndex;
                target.target.SetDirty();
                return defaultIndex;
            }
            set
            {   for (int i = 0; i < keys.Length; i++) target.target.compiler.DisableKeywordAndNotUpdate(keys[i]);
                bool hasnull = keys.Any(k => k == null);
                if ((value != 0 || !hasnull) && value >= 0 && value < keys.Length) target.target.compiler.EnableKeywordAndNotUpdate(keys[value]);
                target.target.compiler.UpdateCompiler();
            }
        }
        
        public void DrawPop(string title = null, Rect? r = null)
        {   if (r == null) r = EditorGUILayout.GetControlRect(GUILayout.Height(FastWaterModel20ControllerEditor.H));
            var newV = title != null ? EditorGUI.Popup(r.Value, title, VALUE, contents) : EditorGUI.Popup(r.Value, VALUE, contents);
            if (newV != VALUE)
            {   target.target.Undo(true);
                VALUE = newV;
                target.target.SetDirty();
            }
        }
    }
    
