    static Dictionary<string, Texture2D> __ICONS
    {   get
        {   if (_data_icons == null)
            {
            
                #if DEBUG_ICONS
                /// DEBUG
                __data_icons = AssetDatabase.GetAllAssetPaths()
                               .Where(p => p.StartsWith("Assets/EModules/Mobile Water Icons"))
                               .Select(p => AssetDatabase.LoadAssetAtPath<Texture>(p) as Texture2D).Where(t => t)
                               .Select(t => t.name + " " + System.Convert.ToBase64String(t.EncodeToPNG()))
                               .Aggregate((a, b) => a + '\n' + b) + '\n';
                /// DEBUG
                #endif
                if (!Application.isPlaying) Resources.FindObjectsOfTypeAll<Texture2D>().Where(n => n.name == "#1REM").ToList().ForEach(t => DestroyImmediate(t));
                _data_icons = new Dictionary<string, Texture2D>();
                foreach (var line in __data_icons.Split('\n'))
                {   if (line.Length == 0) continue;
                    var name = line.Split(' ')[0];
                    var t_string = line.Split(' ')[1];
                    var t = new Texture2D(1, 1, TextureFormat.ARGB32, false);
                    t.hideFlags = HideFlags.DontSave;
                    t.LoadImage(System.Convert.FromBase64String(t_string));
                    t.name = "#1REM";
                    t.Apply();
                    _data_icons.Add(name.ToLower(), t);
                }
            }
            return _data_icons;
        }
    }
    
    
